import React from 'react'

function About (){
    const textStyle = {
        textAlign: 'center',
        color: 'black'
    }
    return (
        <div>
            <h1 style={textStyle}>ABOUT</h1>
            <p style={textStyle}>BLANABLAALBA</p>
        </div>  
    )    
}

export default About
